def FizzBuzz(n):

    def is_divisible(numerator, divisor):
        while numerator > divisor:
            numerator -= divisor
        return numerator == 0
    for i in range(1, n + 1):
        if is_divisible(i, 15):
            print('FizzBuzz')
        elif is_divisible(i, 3):
            print('Fizz')
        elif is_divisible(i, 5):
            print('Buzz')
        else:
            print(i)

